import React from 'react'
import nav from '../styles/HiddenNav.module.css';

const HiddenNav = () => {
  return (
    <aside className={nav.main}>
      <nav className={nav.side}>
        <ul>
          <li>
            <a href="#">
              <imag src="" alt="Current user profile picture" />
            </a>
          </li>
        </ul>
      </nav>
    </aside>
  )
}

export default HiddenNav;
